import{_ as d,c as e,o as a,a2 as r}from"./chunks/framework.CXlnX6pr.js";const s=JSON.parse('{"title":"生命周期","description":"","frontmatter":{},"headers":[],"relativePath":"uni-app/lifecycle.md","filePath":"uni-app/lifecycle.md"}'),n={name:"uni-app/lifecycle.md"};function o(p,t,c,l,i,u){return a(),e("div",null,t[0]||(t[0]=[r('<h1 id="生命周期" tabindex="-1">生命周期 <a class="header-anchor" href="#生命周期" aria-label="Permalink to &quot;生命周期&quot;">​</a></h1><h2 id="应用生命周期" tabindex="-1"><a href="https://uniapp.dcloud.net.cn/collocation/App.html#applifecycle" target="_blank" rel="noreferrer">应用生命周期</a> <a class="header-anchor" href="#应用生命周期" aria-label="Permalink to &quot;[应用生命周期](https://uniapp.dcloud.net.cn/collocation/App.html#applifecycle)&quot;">​</a></h2><ul><li>应用生命周期仅可在 <code>App.vue</code> 中监听，在其它页面监听无效</li></ul><table><thead><tr><th>函数名</th><th>说明</th><th>平台兼容</th></tr></thead><tbody><tr><td>onLaunch</td><td>当 <code>uni-app</code> 初始化完成时触发（全局只触发一次），参数为应用启动参数，同 <a href="https://uniapp.dcloud.net.cn/api/getLaunchOptionsSync.html#getlaunchoptionssync" target="_blank" rel="noreferrer">uni.getLaunchOptionsSync</a> 的返回值</td><td></td></tr><tr><td>onShow</td><td>当 <code>uni-app</code> 启动，或从后台进入前台显示，参数为应用启动参数，同 <a href="https://uniapp.dcloud.net.cn/api/getLaunchOptionsSync.html#getlaunchoptionssync" target="_blank" rel="noreferrer">uni.getLaunchOptionsSync</a> 的返回值</td><td></td></tr><tr><td>onHide</td><td>当 <code>uni-app</code> 从前台进入后台</td><td></td></tr><tr><td>onError</td><td>当 <code>uni-app</code> 报错时触发</td><td>app-uvue 不支持</td></tr><tr><td>onUniNViewMessage</td><td>对 <code>nvue</code> 页面发送的数据进行监听，可参考 <a href="https://uniapp.dcloud.net.cn/tutorial/nvue-api.html#communication" target="_blank" rel="noreferrer">nvue 向 vue 通讯</a></td><td>app-uvue 不支持</td></tr><tr><td>onUnhandledRejection</td><td>对未处理的 Promise 拒绝事件监听函数（2.8.1+ app-uvue 暂不支持）</td><td>app-uvue 不支持</td></tr><tr><td>onPageNotFound</td><td>页面不存在监听函数</td><td>app-uvue 不支持</td></tr><tr><td>onThemeChange</td><td>监听系统主题变化</td><td>app-uvue 不支持</td></tr><tr><td>onLastPageBackPress</td><td>最后一个页面按下Android back键，常用于自定义退出</td><td>app-uvue-android 3.9+</td></tr><tr><td>onExit</td><td>监听应用退出</td><td>app-uvue-android 3.9+</td></tr></tbody></table><h2 id="页面生命周期" tabindex="-1"><a href="https://uniapp.dcloud.net.cn/tutorial/page.html#lifecycle" target="_blank" rel="noreferrer">页面生命周期</a> <a class="header-anchor" href="#页面生命周期" aria-label="Permalink to &quot;[页面生命周期](https://uniapp.dcloud.net.cn/tutorial/page.html#lifecycle)&quot;">​</a></h2><ul><li><code>uni-app</code> 页面除支持 <code>Vue</code> 组件生命周期外还支持下方页面生命周期函数，当以组合式 <code>API</code> 使用时，在 <code>Vue2</code> 和 <code>Vue3</code> 中存在一定区别，请分别参考：<a href="https://uniapp.dcloud.net.cn/tutorial/vue-composition-api.html" target="_blank" rel="noreferrer">Vue2 组合式 API 使用文档</a> 和 <a href="https://uniapp.dcloud.net.cn/tutorial/vue3-composition-api.html" target="_blank" rel="noreferrer">Vue3 组合式 API 使用文档</a></li></ul><table><thead><tr><th>函数名</th><th>说明</th><th>平台差异说明</th><th>最低版本</th></tr></thead><tbody><tr><td>onInit</td><td>监听页面初始化，其参数同 onLoad 参数，为上个页面传递的数据，参数类型为 Object（用于页面传参），触发时机早于 onLoad</td><td>百度小程序</td><td>3.1.0+</td></tr><tr><td><code>onLoad</code></td><td>监听页面加载，该钩子被调用时，响应式数据、计算属性、方法、侦听器、props、slots 已设置完成，其参数为上个页面传递的数据，参数类型为 Object（用于页面传参），参考<a href="https://uniapp.dcloud.net.cn/api/router#navigateto" target="_blank" rel="noreferrer">示例</a></td><td></td><td></td></tr><tr><td>onShow</td><td>监听页面显示，页面每次出现在屏幕上都触发，包括从下级页面点返回露出当前页面</td><td></td><td></td></tr><tr><td>onReady</td><td>监听页面初次渲染完成，此时组件已挂载完成，DOM 树($el)已可用，注意如果渲染速度快，会在页面进入动画完成前触发</td><td></td><td></td></tr><tr><td>onHide</td><td>监听页面隐藏</td><td></td><td></td></tr><tr><td><code>onUnload</code></td><td>监听页面卸载</td><td></td><td></td></tr><tr><td>onResize</td><td>监听窗口尺寸变化</td><td>App、微信小程序、快手小程序</td><td></td></tr><tr><td>onPullDownRefresh</td><td>监听用户下拉动作，一般用于下拉刷新，参考<a href="https://uniapp.dcloud.net.cn/api/ui/pulldown.html" target="_blank" rel="noreferrer">示例</a></td><td></td><td></td></tr><tr><td><code>onReachBottom</code></td><td>页面滚动到底部的事件（不是scroll-view滚到底），常用于下拉下一页数据。具体见下方注意事项</td><td></td><td></td></tr><tr><td>onTabItemTap</td><td>点击 tab 时触发，参数为Object，具体见下方注意事项</td><td>微信小程序、QQ小程序、支付宝小程序、百度小程序、H5、App、快手小程序、京东小程序</td><td></td></tr><tr><td><code>onShareAppMessage</code></td><td>用户点击右上角分享</td><td>微信小程序、QQ小程序、支付宝小程序、抖音小程序、飞书小程序、快手小程序、京东小程序</td><td></td></tr><tr><td>onPageScroll</td><td>监听页面滚动，参数为Object</td><td>nvue不支持</td><td></td></tr><tr><td>onNavigationBarButtonTap</td><td>监听原生标题栏按钮点击事件，参数为Object</td><td>App、H5</td><td></td></tr><tr><td>onBackPress</td><td>监听页面返回，返回 event = {from:backbutton、 navigateBack} ，backbutton 表示来源是左上角返回按钮或 android 返回键；navigateBack表示来源是 uni.navigateBack；<a href="https://uniapp.dcloud.net.cn/tutorial/page.html#onbackpress" target="_blank" rel="noreferrer">详见</a></td><td>app、H5、支付宝小程序</td><td></td></tr><tr><td>onNavigationBarSearchInputChanged</td><td>监听原生标题栏搜索输入框输入内容变化事件</td><td>App、H5</td><td>1.6.0</td></tr><tr><td>onNavigationBarSearchInputConfirmed</td><td>监听原生标题栏搜索输入框搜索事件，用户点击软键盘上的“搜索”按钮时触发</td><td>App、H5</td><td>1.6.0</td></tr><tr><td>onNavigationBarSearchInputClicked</td><td>监听原生标题栏搜索输入框点击事件（pages.json 中的 searchInput 配置 disabled 为 true 时才会触发）</td><td>App、H5</td><td>1.6.0</td></tr><tr><td><code>onShareTimeline</code></td><td>监听用户点击右上角转发到朋友圈</td><td>微信小程序</td><td>2.8.1+</td></tr><tr><td>onAddToFavorites</td><td>监听用户点击右上角收藏</td><td>微信小程序、QQ小程序</td><td>2.8.1+</td></tr></tbody></table><h2 id="vue3-生命周期" tabindex="-1"><a href="https://uniapp.dcloud.net.cn/tutorial/vue3-api.html#%E9%80%89%E9%A1%B9-%E7%94%9F%E5%91%BD%E5%91%A8%E6%9C%9F%E9%92%A9%E5%AD%90" target="_blank" rel="noreferrer">Vue3 生命周期</a> <a class="header-anchor" href="#vue3-生命周期" aria-label="Permalink to &quot;[Vue3 生命周期](https://uniapp.dcloud.net.cn/tutorial/vue3-api.html#%E9%80%89%E9%A1%B9-%E7%94%9F%E5%91%BD%E5%91%A8%E6%9C%9F%E9%92%A9%E5%AD%90)&quot;">​</a></h2>',8)]))}const f=d(n,[["render",o]]);export{s as __pageData,f as default};
